import React from "react";

interface Header2Props {
  title: string
}

export const Header2 = (props: Header2Props) => {
  const { title } = props;

  return (
    <header className="flex justify-center p-4 w-full text-3xl font-bold bg-secondary">
      <p className="uppercase text-center">
        {title}
      </p>
    </header>
  )
}
